import React from 'react';

const Dashboard = ({photos}) => {

  let photoEls = photos.length ?
    photos.map(photo => {
      return <div className="photo-wrapper">
        {photo}
      </div>
    }) :
    <div className="no-photos"> no images yes, please upload some! </div>;

    console.log('photos', photos);
  return (
    <div className="dashboard-wrapper">
      {photoEls}
    </div>
  )
}

export default Dashboard;
